def find_key():
    """
    Sử dụng Định lý số dư Trung Hoa (CRT) để giải hệ phương trình
    đồng dư trong hàm verify_key và tìm ra key 32-bit.
    """
    print("[+] Bắt đầu tìm key 32-bit bằng Định lý số dư Trung Hoa...")

    # Các giá trị được trích xuất từ hàm verify_key
    # local_38 là mảng các số chia (moduli)
    moduli = [0x7b, 0x1c8, 0x315, 0x3db, 0x28e, 0x141]
    
    # local_68 là mảng các số dư (remainders)
    remainders = [0x5c, 0x1d, 0x17c, 2, 0x1f1, 0x128]
    
    # Sử dụng hàm crt từ thư viện sympy để giải
    # crt trả về một tuple (kết quả, tích của các số chia)
    key32, _ = crt(moduli, remainders)
    
    print(f"[+] Tìm thấy key 32-bit: {key32} (Dạng hex: 0x{key32:x})")
    return int(key32)

